import React from 'react';
import {Container, AppBar, Typography, Grow, Grid} from '@material-ui/core';

const App = () => {
    return (
        <div>
            <Container maxWidth="lg">
                <AppBar position="static">
                    <Typography variant="h2" align="center">
                        davinci
                    </Typography>
                </AppBar>
            </Container>
        </div>
    );
};

export default App;
